import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Apply Price Range Filter
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'Electronics');
    await page.click('.search-btn');

    // Wait for price filter elements
    await page.waitForSelector('.price-filter', { timeout: 5000 });
    await page.fill('.price-input', '100'); // Set minimum price
    await page.fill('.price-input', '500'); // Set maximum price
    await page.click('.apply-filter');

    // Take screenshot after applying filter
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_price_filter_applied.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_price_filter_applied.png'));

    return {
      success: true,
      action: "Applied price range filter",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
